('6nB1495629007Jwx', 'Custom Functions', 'uQF1495626426wbB', 'Lear how to build your own custom functions!', 10, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('6O71495629007hxF', 'Ch4 - Variables', 'Zgx1495626426muM', 'Variables are virtual containers used to hold information in JavaScript. Actually, all programming languages use variables, so once you know what JavaScript variables are, you know variables in all languages.', 3, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('6pU1495629007XkY', 'Ch4 - PHP Includes', 'DyV1495626426yjf', 'PHP includes allow you to include/insert code from other pages.', 3, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('7ai1495629007pTQ', 'Ch7 - HTML Tables', '0G71495626426zAh', 'Tables are a set of tags that allow you to create spreadsheet-like things in your web pages.', 6, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('7Zo1495629007i99', 'Processing Forms', 'uQF1495626426wbB', 'We introduce form processing using PHP.', 6, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('8FC1495629007Vv5', 'Functions Continued', 'vTM14956264263mk', 'We return to Javascript functions', 8, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
