('8zY1495629007nut', 'Pagination', 'Zuk1495626426pXb', 'Learn how to integrate pagination', 1, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('9QA1495629007Bas', 'Ch9 - PHP Loops', 'DyV1495626426yjf', 'As you know, doing repetitive tasks is a big part of programming. PHP like JavaScript, has a few types of loops you can use.', 8, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('A8K1495629007RTV', 'Ch1 - The Basics', '0G71495626426zAh', 'A gentle introduction to some of the basic concepts.', 0, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('ajV1495629007ryR', 'Ch7 - Loops', 'Zgx1495626426muM', 'Repeating a tasks over and over again, is one of the advantages of computers, since they can do them much faster than we can. That''s where loops come in.', 6, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('aK81495629007q0n', 'Ch2 - Your First PHP Code', 'DyV1495626426yjf', 'Now it''s time to start writing code!', 1, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('aOt1495629007Kez', 'Conclusion', 'uQF1495626426wbB', '', 12, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('aUV1495629007INb', 'Javascript DOM', 'vTM14956264263mk', 'We introduce the Javascript Document Object Model (DOM).', 9, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('aZF1495629007dVo', 'Ch3 - Diving deeper into CSS', 'JCG1495626426HyA', 'This chapters covers both practical CSS subjects like background images, using Google fonts and using built-in browser development tools. But we also dive deeper down the CSS rabbit hole, while we explore concepts like the CSS cascade.', 2, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('bgH1495629007KF6', 'Ch2 - CSS Styling Basics', 'JCG1495626426HyA', 'With the basic CSS concepts under your belt, you are ready to explore CSS color, CSS text formatting, CSS fonts and even ''nerd'' details about parent / child tag relationships!', 1, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('bKx1495629007wtE', 'Introduction', '0NY1495626426I3U', 'The hardest thing to learn (and teach btw,) in object oriented PHP is the basics. But once you understand them, the rest will come much, much easier. But don''t be discouraged! You just found the easiest to understand tutorial out there on OOP and PHP. It may sound like a boastful claim, I know, but that''s what the nerd zeitgeist is saying. � Or so I''ve been told. Lesson Description:Lesson Description:Lesson Description:Lesson Description:Lesson Description:Lesson Description:', 0, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('cES1495629007LRz', 'Includes', 'uQF1495626426wbB', 'Learn how to link many different PHP files in your script.', 4, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('CZy14956290074qX', 'Introduction', 'irB1495626426nlc', 'An introduction to our Beginners Wordpress course', 0, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('DJc1495629007Mxc', 'Ch4 - The Box Model', 'JCG1495626426HyA', 'Around every tag, there is a virtual box that has margin, borders and padding. The chapter explores all these and much more.', 3, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
('Enq1495629007x3Q', 'Ch1 - Introduction to JavaScript', 'Zgx1495626426muM', 'In this chapter we jump in head first into JavaScript writing code while learning some basic concepts.', 0, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
