('Fsf1495629007A6J', 'Ch12 - Advanced PHP', 'DyV1495626426yjf', 'We build a log in mini app (from scratch) combining PHP sessions. form processing and a couple of new PHP tricks!', 11, '2017-05-23 21:00:07', '2017-05-23 21:00:07'),
