('0G71495626426zAh', 'Beginners HTML 2015', '4ha1490759903Yyn', 'In this course you will learn the basics of HTML5, which is the foundation language of web design and web development. This is the first step in learning how to code web apps. By the end of the course, you will be able to build simple websites.\r\nBut more important, you will understand many key nerd concepts, that will propel you towards becoming an app developer.\r\n\r\n', 'sourcefiles.zip', 21200, 366, 1, 0, 1, 1, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('0NY1495626426I3U', 'Beginners OOP PHP', '4ha1490759903Yyn', '\r\nLearn the basics of object oriented PHP.\r\n\r\nCan this accept basic HTML formatting. We need style for our body text.\r\n\r\nSome of things we will cover:\r\n\r\n', '', 50, 7, 25, 18, 1, 10, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('1ch1495626426Abg', 'Web Foundations Exam', '2lr1490760127ma7', '\r\nThe Web Foundations Exam is a closed-book (no videos) multiple choice quiz designed to test your knowledge of the five foundation web courses: \r\n\r\nBeginners HTML, Beginners CSS, Beginners Javascript, Beginners PHP, and PHP and MySQL\r\n\r\nDifficulty: Beginner / Intermediate\r\nClass Time: 2 hours\r\nMaximum Points for this Course: 6300pts\r\nQuestions: 105 multiple choice\r\n', '', 6300, 110, 0, 14, 1, 0, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('AfT1495626426mkH', 'Beginners HTML', '4ha1490759903Yyn', '\r\nIf you want to build websites, you need to start with the basics. These video courses cover the key basics that will form the foundation of any web designer or programmer. A gentle and practical introduction to HTML for any beginner.\r\n\r\nDifficulty: Beginner\r\nClass Time: 3 hours\r\nTotal Running Time: 1h33m (14 videos)\r\nQuestions: 49 multiple choice and 24 code challenges\r\n', 'sourcefiles.zip', 5340, 87, 0, 15, 1, 3, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('cCs1495626426zXy', 'PHP and MySQL', '4ha1490759903Yyn', '\r\nDatabases are an important part of all websites as it allows you to store all types of data.\r\nPHP and MySQL are basic skills every web developer needs to know. \r\nThis course teaches you the basics of SQL, how to use the very popular PHPMyAdmin to manage your databases, as well as using MySQL with PHP.\r\n\r\nDifficulty: Intermediate\r\nClass Time: 4 hours\r\nTotal Running Time: 1h54m (13 videos)\r\nQuestions: 8 multiple choice, 11 code challenges, and 1 chapter review\r\n', '', 1830, 35, 29.99, 7, 1, 11, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('dcW1495626426UMJ', 'PHP Tag Cloud', '8UW1490760420wGR', '\r\nA tag cloud is a visual representation of text, normally associated with keywords on websites. In this video course, we teach you how to create a tag cloud using PHP.\r\n\r\nDifficulty: Intermediate\r\nClass Time: 2 hours\r\nTotal Running Time: 51m (5 videos)\r\nQuestions: 1 multiple choice and 10 code challenges\r\n', 'tagcloud-projectfiles.zip', 1060, 16, 0, 12, 1, 10, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('DyV1495626426yjf', 'Beginners PHP 2015', '4ha1490759903Yyn', 'PHP is the most popular server-side programming language. Over 80% of web apps are powered by PHP, including Facebook and apps like Wordpress, Joomla and Drupal.\r\nPrereqs: You should have completed the beginners HTML, CSS and JavaScript courses.\r\n\r\n', 'sourcefiles.zip', 8260, 167, 1, 6, 1, 1, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('gb614956264260C5', 'Beginners jQuery', '4ha1490759903Yyn', '', 'sourcefiles.zip', 60, 10, 20, 21, 1, 10, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('ILS1495626426u1y', 'Javascript Exam', '2lr1490760127ma7', '', 'sourcefiles.zip', 0, 0, 1, 5, 1, 1, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('irB1495626426nlc', 'Beginners Wordpress', '4ha1490759903Yyn', '\r\nLearn about the very basics of installing, configuring and using Wordpress for your standard website.\r\nYou quickly understand how to install and use Wordpress to do all the common Wordpress tasks: Installing Wordpress, Adding Wordpress users, Installing a Wordpress theme, how to configure and customize a Wordpress theme\r\n\r\nDifficulty: Beginner - Age 12 and up\r\nClass Time: 6 hours\r\nTotal Running Time: 2h46m (18 videos)\r\n', '', 1980, 51, 0, 8, 1, 0, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('JCG1495626426HyA', 'Beginners CSS 2015', '4ha1490759903Yyn', 'CSS is short for Cascading Style Sheets, and it is the computer language that allows you to add color, design and layout to your websites. It is the styling language of web design and web development. Having a basic understanding of CSS is fundamental for any web developer.\r\nPrereqs: You should have completed the beginners HTML course.\r\n\r\n', 'sourcefiles.zip', 21420, 399, 1, 2, 1, 4, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('o3x1495626426CCg', 'HTML5 CSS3 and jQuery', '8UW1490760420wGR', '\r\nHTML5 and CSS3 is the new standard of web design and development. It has tons of rich features which allows you to make beautiful looking web pages. \r\nJQuery is a Javascript library (canned javascripts) that make it really easy to create all kinds of cool web widgets. \r\nThis course will teach you how to apply these new techniques in the most practical way possible. Learn how to take an old existing HTML document and convert it to a modern looking website using HTML5/CSS3 and jQuery!\r\n\r\nDifficulty: Intermediate\r\nClass Time: 6 hours\r\nTotal Running Time: 4h09m (28 videos)\r\nQuestions: 2 multiple choice, 20 code challenges, and 2 chatper reviews\r\n', 'html5-css3-jquery-source-files.zip', 2620, 52, 29.99, 9, 1, 15, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('Ogy1495626426tkI', 'PHP Login with OOP and MVC', '8UW1490760420wGR', '\r\nThis practical video course will teach you how to create a PHP login form using object-oriented techniques and the MVC design pattern. This course is designed for the brainiacs in class.\r\n\r\nDifficulty: Intermediate - advanced.\r\nClass Time: 3 hours\r\nTotal Running Time: 1h28m (10 videos)\r\nQuestions: 4 multiple choice and 16 code challenges\r\n', 'oopphplogin-projectfiles.zip', 1840, 30, 1, 13, 1, 12, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('OLO1495626426r2i', 'Beginners CSS', '4ha1490759903Yyn', '\r\nCSS, which stands for Cascading Style Sheets, is the sister technology to HTML that allows you to easily style the HTML elements within your web site. Having a basic understanding of CSS is fundamental for any web designer or programmer!\r\n\r\nDifficulty: Beginners\r\nClass Time: 8 hours\r\nTotal Running Time: 5h30m (32 videos)\r\nQuestions: 71 multiple choice, 28 code challenges, and 1 chapter review\r\n', 'sourcefiles.zip', 7130, 129, 39.99, 16, 1, 30, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('Q2p1495626426s7P', 'CSS3 Exam', '2lr1490760127ma7', '', 'sourcefiles.zip', 0, 0, 1, 3, 1, 1, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('uQF1495626426wbB', 'Beginners PHP', '4ha1490759903Yyn', '\r\nPHP is the most popular server side web programming language out there. PHP is one of the fundamental languages that every web designer should learn since so many common tasks are accomplished with PHP: processing forms, sending emails, creating shopping carts and much more.\r\nIf you want to be a complete web designer (and beat the competition) you must learn at least basic PHP. You will not regret it!\r\n\r\nDifficulty: Beginner\r\nClass Time: 8 hours\r\nTotal Running Time: 4h50m (27 videos)\r\nQuestions: 23 multiple choice, 27 code challenges, 5 chapter reviews\r\n', '', 5330, 83, 39.99, 20, 1, 23, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('usz14956264263UO', 'HTML5 Exam', '2lr1490760127ma7', '', 'sourcefiles.zip', 0, 1, 1, 1, 1, 3, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('vJo1495626426R2N', 'Form Validation with PHP and Javascript', '8UW1490760420wGR', '\r\nLearn how to use both PHP and Javascript to validate HTML forms. Proper form validation is helpful to everyone involved.\r\n\r\nIt allows the web developer to double check the data being sent to the server\r\nIts helpful for the user, as they can be assured that any data entered into the form is mistake free\r\nIt is also helpful for the site owner, as they can be assured that any data they receive is valid\r\nIf your goal is to learn how to properly validate HTML forms, this is the course for you!\r\nDifficulty: Intermediate\r\nClass Time: 2 hours\r\nTotal Running Time: 1h01m (6 videos)\r\nQuestions: 2 multiple choice and 8 code challenges\r\n', 'validation-projectfiles.zip', 920, 16, 29.99, 10, 1, 8, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('vTM14956264263mk', 'Beginners Javascript', '4ha1490759903Yyn', '\r\nJavascript is the programming language built into every web browser, and is the most popular programming language in the world. If you want to validate forms, create drop-down menus, use jQuery and a whole slew of other effects, you need to learn at least basic Javascript.\r\n\r\nDifficulty: Beginner\r\nClass Time: 8 hours\r\nTotal Running Time: 5h10m (39 videos)\r\nQuestions: 19 multiple choice, 20 code challenges, and 9 chapter reviews\r\n', 'javascript-projectfiles.zip', 5390, 87, 39.99, 19, 1, 26, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('XiR14956264260t7', 'HTML Forms', '4ha1490759903Yyn', '\r\nHTML Forms are used to pass data from the User to the server. A form is a vital part of HTML as it allows you to collect information from the user. \r\n\r\nThis simple video course teaches you how to create a form using basic HTML, as well as sending it via email.\r\n\r\nDifficulty: Beginner\r\nClass Time: 2 hours\r\nTotal Running Time: 47min (9 videos)\r\nQuestions: 4 multiple choice, 14 code challenges, and 1 chapter review\r\n', '', 1890, 28, 29.99, 17, 1, 8, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('Zgx1495626426muM', 'Beginners Javascript 2015', '4ha1490759903Yyn', '\r\nJavascript is the programming language built into every web browser, and is the most popular programming language in the world. To take full advantage of HTML5, CSS3 and the web browsers capabilities, you need to learn at least basic Javascript.\r\n\r\nPrereqs: Beginners HTML and Beginners CSS\r\n\r\n', 'sourcefiles.zip', 13620, 279, 1, 4, 1, 5, '2017-05-23 20:17:06', '2017-05-23 20:17:06'),
('Zuk1495626426pXb', 'CRUD with PHP and MySQLi', '8UW1490760420wGR', '\r\nPHP CRUD allows you to create, read, update, and delete records from your database. With CRUD you can create pages to list and edit your records. \r\n\r\nMySQLi is an extension used in PHP to communicate with databases. It offers many benefits (over MySQL) including being more secure and taking advantage of an object oriented interface. This is a great and practical way to learn database communication and object oriented programming techniques with PHP. \r\n\r\nCombining both CRUD and MySQLi will move you on your way to becoming a good and practical PHP programmer.\r\n\r\nDifficulty: Intermediate\r\nClass Time: 3 hours\r\nTotal Running Time: 1h32m (8 videos)\r\nTotal Number of Questions: 3 multiple choice, 13 code challenges, and 1 chapter review\r\n', 'mysqli-projectfiles.zip', 1730, 25, 29.99, 11, 1, 13, '2017-05-23 20:17:06', '2017-05-23 20:17:06');
