('5Vo1496037751knf', 'OPe1495689721wMB', '1125', 4, 'question_multichoice', 60, 15, 'Pages are processed from the top down.', 'CSS selectors and code respect the top-down processing rule.', '&lt;p&gt; text will be brown.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('5vu1496037751zJ9', 'iSw14956897211PA', '1233', 1, 'question_multichoice', 60, 15, 'We did not use margins to make the big move.', 'We did not use the CSS position property.', 'By using the float property and setting it to right.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('5VZ14960377491jw', 'FbH1495689721Ulq', '237', 2, 'question_textarea', 100, 25, 'Use the SELECT, FROM, and WHERE keywords.', 'Dont forget to select the name field. Only select the row where id = 3.', 'Ans:<br /> <br /> SELECT name FROM people WHERE id = 3;', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('5X01496037749U8O', 'y411495689721EMV', '217', 1, 'question_textarea', 100, 25, 'Call the function test_fun', 'Add the string &quot;Hello World&quot; as an argument to the function.', 'Ans:<br /> &lt;?php<br /> <br /> function test_fun($arg)<br /> {<br /> echo $arg;<br /> }<br /> <br /> test_fun(&quot;Hello World&quot;);<br /> <br /> ?&gt;', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('5xA1496037751c4A', 'SHP1495689721Bv1', '1183', 1, 'question_multichoice', 60, 15, 'Absolute absolutely allows you to use those properties!', 'Fixed is fixed on those properties', 'Static does not allow you to use them.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('5yH149603775031s', 'NNC1495689721W12', '856', 4, 'question_textarea', 100, 25, 'This is UPPERCASE and this is lowercase.', 'All tags start with the angled bracket: &lt; ... and close with an angled bracket: &gt;', '&lt;textarea&gt;', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('5Z114960377510zz', 'JHq1495689721cGM', '1230', 0, 'question_multichoice', 60, 15, 'The tag &lt;nav&gt; is short for navigation, and every site has navigation.', 'The tag &lt;main&gt; represents the main part of the of web page - the part where you see most of the content.', 'I just made up "sub section", to try and trick you.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('60w1496037750Jog', 'xB01495689721mX6', '525', 7, 'question_multichoice', 60, 15, 'The word-spacing property sets the space between words in paragraphs', 'The line-height property sets the space between lines in a paragraph', 'Ans: Option 2 - Letter-spacing', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('61J1496037749kQh', 'yRe1495689721Bkw', '266', 0, 'question_chapterreview', 250, 75, 'The following tags must be added/edited using HTML5 syntax: &lt;!DOCTYPE&gt;, &lt;html&gt;, &lt;meta&gt;, &lt;content&gt;, &lt;header&gt;, &lt;nav&gt;, &lt;article&gt;, &lt;section&gt;, &lt;footer&gt;', 'Make sure that every opening tag has its appropriate closing tag: &lt;content&gt;....&lt;/content&gt;', 'Ans:<br /> <br /> &lt;!DOCTYPE HTML&gt;<br /> &lt;html&gt;<br /> &lt;head&gt;<br /> &lt;meta charset=utf-8&gt;<br /> &lt;title&gt;Killersites HTML5 layout Example&lt;/title&gt;<br /> &lt;/head&gt;<br /> <br /> &lt;body&gt;<br /> <br /> &lt;content&gt;<br ', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('64R14960377513Cs', 'GYo1495689721BHI', '1367', 1, 'question_multichoice', 60, 15, 'Remember that isNaN() is checking to see if it is NOT a number.', 'In this example, it would be false since 6 is a number.', '', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('65K14960377496vS', 'HIl1495689721FL6', '322', 1, 'question_textarea', 100, 25, 'Add the type, name, and value attributes to each of the input tags', '- type=&quot;checkbox&quot; <br /> - name=&quot;fruit&quot; <br /> - value=&quot;banana&quot; or &quot;oranges&quot; or &quot;strawberry&quot;', 'Ans:<br /> <br /> &lt;html&gt;<br /> &lt;body&gt;<br /> <br /> &lt;form&gt;<br /> <br /> &lt;input type=&quot;checkbox&quot; name=&quot;fruit&quot; value=&quot;banana&quot;/&gt; banana &lt;br /&gt;<br /> &lt;input type=&quot;checkbox&quot; name=&quot;frui', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('68h14960377518mL', 'OZd1495689721o1q', '1442', 0, 'question_multichoice', 60, 15, 'The onSubmit event handler is only needed IF you want to use JS on the form.', 'The "id" attribute is used by JS and CSS .. but it does not change what the browser submits.', 'You must add the "name" attribute, and provide a name for each form tag when you want the data (in that tag) submitted.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('68S1496037750Ph3', 'gOi1495689721Sjq', '960', 2, 'question_multichoice', 60, 15, 'The div with the ID of centerDoc cannot be set to "right".', 'Margin is often used to shift tags into position with page layout.', 'I added MARGIN to the LEFT of the div with the ID of "centerDoc".', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('69o1496037750LHc', 'n4X149568972107J', '952', 0, 'question_multichoice', 60, 15, 'The browser window is actually called the "viewport".', 'The box model has to do with HTML tags.', 'The box model is a virtual box that wraps around tags.', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('6BC1496037749YKa', 'jqt1495689721kOR', '386', 2, 'question_multichoice', 60, 15, 'The text-transform property can set all of the text to lowercase or uppercase', 'The text-transform property can also capitalize the first letter of every word.', 'Ans: Option 1 - To specify if text will be set in lowercase, uppercase, or capitalized', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('6cV1496037751Nx6', 'J721495689721CnJ', '1396', 1, 'question_multichoice', 60, 15, 'The variable "tag" does have a value.', 'The variable "tag" is referring to the tag with the ID of "topheader".', 'The variable "tag" is referencing the tag with the ID of "topheader".', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('6DV1496037750cxC', 'Qwf1495689721fVn', '832', 0, 'question_multichoice', 60, 15, 'HTML describes what is in the page.', 'HTML is not supposed to be used to add style to a page - you use CSS for that.', 'HTML tells the browser what is in the page, and the meaning of what is in the page.', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('6Dx149603775163l', 'bNK14956897210LX', '1528', 0, 'question_multichoice', 60, 15, 'You can only control what the browser does after it submits a form, with JavaScript.', 'The "method" attribute tells web browsers HOW to send information: get or post', 'Tells the web browser WHERE to send the information.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('6E81496037751NZC', 'HUE1495689721YpO', '1397', 0, 'question_textarea', 100, 25, 'onload is an event handler.', 'This is the event handler with the function call: onload=&quot;alert("Get rid of me!")&quot;', '&lt;body&gt;', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('6i31496037751p9z', 'ef91495689721btA', '1288', 1, 'question_multichoice', 60, 15, 'onclick tracks when someone clicks on a tag.', 'onmouseover tracks when someone moves the mouse pointer over a tag.', 'onload - is short for "on page load"', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('6Ia1496037751MfF', 'hwr1495689721DZx', '1335', 2, 'question_multichoice', 60, 15, 'One of the answers is true.', 'It helps you to make less errors.', '', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('6ig14960377510BA', 'Hix1495689721ED9', '1507', 3, 'question_multichoice', 60, 15, 'Are good coding habits is a part of best practices', 'Well formatted code is a part of best practices.', 'All of the above.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
