('6O71496037749Feq', 'yEw1495689721bdy', '336', 1, 'question_textarea', 100, 25, 'Use the PHP &quot;include_once&quot; function', 'Add the filename as the argument of the function', 'Ans:<br /> <br /> &lt;?php<br /> <br /> include_once("tagcloud.model.php");<br /> <br /> ?&gt;', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('6Sf1496037750o0C', 'aR61495689721xAB', '1027', 1, 'question_multichoice', 60, 15, 'Tag selectors are kinda like all-or-one selectors - it"s either all, or none.', 'All the &lt;h1&gt; tags!', '', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('6tW1496037751kiN', 'Eia1495689721XlM', '1459', 0, 'question_multichoice', 60, 15, '', '', '', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('6u31496037749aeG', 'Err1495689721iJr', '127', 2, 'question_textarea', 100, 25, '- Add the expression to the while loop &quot;a &lt; 10&quot;', '- Incrementing the value of a requires the ++ operator', 'Ans:<br /> <br /> &lt;script type=&quot;text/javascript&quot;&gt;<br /> var a = 1;<br /> <br /> while (a &lt; 10)<br /> {<br /> document.write(a);<br /> a++;<br /> }<br /> <br /> &lt;/script&gt;', '2017-05-29 02:32:29', '2017-05-29 02:32:29');
