('6VG1496037750tKV', 'w2q1495689721hCN', '1045', 0, 'question_multichoice', 60, 15, 'Adaptive design is static, but it uses other techniques so it works well on phones and other devices with smaller screens.', 'Adaptive design is not liquid.', 'Option 2', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('6Vn14960377497MN', 'Qtr14956897214IN', '167', 0, 'question_multichoice', 60, 15, 'Both local and global variables are common across most programming languages including Javascript', 'Local variables are unaccessible outside the function in which they exist.', 'Ans: Option 3 - Local variables are local to functions. Global variables are available to all.', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('6Wb1496037749pa4', 'FbH1495689721Ulq', '235', 0, 'question_textarea', 100, 25, '- The table people must be placed within these quotes: `people` OR no quotes at all: people<br /> - Use the * symbol to represent all the rows', 'Use the SELECT and FROM keywords.', 'Ans:<br /> <br /> SELECT * FROM `people`;', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('6WN1496037749jGO', '1o41495689721KOn', '428', 0, 'question_multichoice', 60, 15, 'It is NOT liquid positioning', 'It is NOT normal positioning', 'Ans: Option 3 - Static positioning', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('6yo1496037751usR', 'JoX1495689721oBj', '1471', 2, 'question_multichoice', 60, 15, 'PHP is a server-side programming language.', 'Web browsers DO NOT process PHP code.', 'The web server sends the PHP page to the PHP app, to process the PHP code.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('77914960377515Or', '1X214956897218do', '1419', 0, 'question_multichoice', 60, 15, 'Functions are great for reusing code.', 'Functions DO allow you to control when code is run', 'This is NOT true: functions can only be used once in a web page.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('78R1496037750CGB', 'yUE1495689721F4Q', '792', 7, 'question_multichoice', 60, 15, 'There is no number attribute.', 'You don"t need CSS to set the number beside the list item.', 'The item"s position (in the list) tells the web browser what number is beside it.', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('7Ao1496037750aHI', 'N0J1495689721x21', '1064', 1, 'question_multichoice', 60, 15, 'It has nothing to do with a language called prototype.', 'Using named colors is a quick way to see how things look.', 'It is a page built super quick, just to see how things look.', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('7bN1496037751K0L', 'Yxz14956897215PW', '1555', 1, 'question_multichoice', 60, 15, 'To increment, is to increase the count by 1. So 1 becomes 2, and 2 becomes 3 et cetera ...', 'This is the decrement operator: --$i', '$i++', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('7dv1496037749hSV', 'ZUQ149568972148Z', '269', 1, 'question_multichoice', 60, 15, 'MySQLi is known the be more secure because of its use of prepared statements', 'MySQLi is also object oriented', 'Ans: Option 4 - All of the above', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('7eV1496037751tMW', '6lA1495689721QHf', '1463', 3, 'question_textarea', 100, 25, 'Instead of a forward leaning slash, PHP uses the question mark: ?', '?&gt;', '&lt;?php ?&gt;', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('7fd1496037750PK5', 'fuL1495689721wjh', '748', 3, 'question_multichoice', 60, 15, 'It"s NOT "None of the above".', 'It is a cycle, but not just a "Web" cycle.', 'It"s the request / response cycle! But you knew that already...', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('7G91496037749GPV', 'yjl1495689721QgV', '206', 2, 'question_textarea', 100, 25, 'Capture the return of the function str_word_count in the variable $result', 'Echo the $result variable. Check your brackets, quotes, and semicolon.', '&lt;?php<br /> <br /> $result = str_word_count(&quot;The quick brown fox jumps over the lazy dog&quot;);<br /> <br /> echo $result;<br /> <br /> ?&gt;', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('7HE1496037749Ce4', '56z1495689721cMP', '312', 1, 'question_textarea', 100, 25, 'Check to see if the &quot;name&quot; data is empty: $form["name"] == ""', 'Change the &quot;$valid_form&quot; to false: $valid_form = FALSE;', 'Ans:<br /> <br /> &lt;form action=&quot;&quot; method=&quot;post&quot; id=&quot;form&quot;&gt;<br /> <br /> &lt;label for=&quot;name&quot;&gt;Name:&lt;/label&gt;<br /> &lt;input type=&quot;text&quot; name=&quot;name&quot; id=&quot;name&quot; class=&quot;r', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('7Jm1496037749a6e', 'C3b1495689721JCh', '368', 5, 'question_multichoice', 60, 15, 'The &lt;script&gt; tag is used only for client side script like Javascript', 'It is not used for PHP, which is server side', 'Ans: Option 1 - It is used to link to a client side script like javascript', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
