('7SW1496037749Qs1', 'vvG1495689721z5w', '263', 1, 'question_multichoice', 60, 20, 'Used to insert code after certain CSS properties are applied', 'Ans: Option 1 - Allows you to insert content after the CSS code has been displayed', '', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
