('7wn1496037750p17', 'LkU1495689721dKO', '899', 3, 'question_textarea', 100, 25, 'Table row closing tags look like this: &lt;/tr&gt;', 'Table data closing tags look like this: &lt;/td&gt;', '&lt;tr&gt;&lt;td colspan=&quot;3&quot;&gt;List of Stats&lt;/td&gt;&lt;/tr&gt;', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('7xY14960377516Xo', '6zT1495689721PzN', '1426', 2, 'question_textarea', 100, 25, 'You need to separate each parameter when you define a function.', 'Parameters/arguments are separated by a comma: ,', 'function myFunckyFunction(theID, theName) {<br /> <br /> return theID + theName;<br /> <br /> }', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
