('7Z01496037751AnF', 'CTv1495689721dlB', '1549', 1, 'question_textarea', 100, 25, 'date();', 'date(&quot;y/m/d&quot;);', '$todaysDate = date(&quot;y/m/d&quot;);', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('7ZH1496037750fpw', 'ZsC1495689721S51', '630', 3, 'question_multichoice', 60, 15, 'The Akismet plugin does NOT spellcheck all comments', 'The Akismet plugin does NOT automatically close comments on older articles', 'Ans: Opt 3 - Protects your blog from comment spam', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('7ZN1496037751ZVE', 'e5R1495689721XgD', '1563', 1, 'question_textarea', 100, 25, 'This is an opening multi line PHP comment: /*', 'This is a closing multi line PHP comment: */', '&lt;?php<br /> <br /> /*<br /> echo &quot;hide me echo 1&quot;;<br /> echo &quot;hide me echo 2&quot;;<br /> echo &quot;hide me echo 3&quot;;<br /> */<br /> echo &quot;It is my party and I will cry if I want to.&quot;;<br /> ?&gt;', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('84V1496037751oWG', '5Xj1495689721Rpb', '1298', 0, 'question_multichoice', 60, 15, 'HTML provides the structure of the page, but it is not the master of the page.', '"Documentation Objectivacational Manual" ... I made this up!!! :)', 'The HTML DOM is a map of a web page.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('84x1496037749isp', 'e9N1495689721Yp6', '448', 1, 'question_textarea', 100, 25, 'Use the italic tag: &lt;i&gt;', 'Encompass the text with an opening and closing italic tag', 'Ans:<br /> <br /> &lt;html&gt;<br /> <br /> &lt;head&gt;&lt;/head&gt;<br /> <br /> &lt;body&gt;<br /> &lt;i&gt;Grumpy wizards make toxic brew for the evil Queen and Jack&lt;/i&gt;<br /> &lt;/body&gt;<br /> &lt;/html&gt;', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('87s1496037751qMz', 'plF1495689721ZjQ', '1516', 2, 'question_multichoice', 60, 15, 'You can include fancy menus with PHP includes.', 'You can include any type of text with includes.', 'All of the above.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
