('8Bc1496037751s40', 'cIT1495689721xwa', '1578', 1, 'question_multichoice', 60, 15, 'Data is a nerd-word that means: information', 'A storage container is used to hold junk you don"t want in your house. Then after 10 years, you would through all the junk out.', 'True.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
