('8gC1496037749O3E', 'kKP1495689721aNL', '356', 0, 'question_multichoice', 60, 15, 'The action attribute does not save data to the cache memory', 'The action attribute does NOT send data to the browser', 'Ans: Option 2 - It drives data to the specified page when a submit button is pressed', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('8gJ1496037751Lae', 's5U1495689721bJV', '1286', 2, 'question_textarea', 100, 25, 'When creating a custom function, you have to tell JavaScript (that you are creating a function,) with a keyword.', 'The keyword to create a function is: function', 'function myFunction(message) {<br /> <br /> alert(&quot;I am learning to code!&quot;);<br /> <br /> }', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
