('hjx1496037749eIM', 'WWN1495689721CD4', '343', 0, 'question_textarea', 100, 25, 'The first argument in the usort function is the variable to sort. In this question it is the &quot;$tags&quot; variable from the &quot;tagcloud_model&quot; class: $this-&gt;tags', 'The second argument is the comparison function. In this question, we use the &quot;compare_names&quot; function. Since the &quot;compare_names&quot; function is in the same class, we must use an array to reference the class name: array("tagcloud_model", "', 'Ans:<br /> <br /> &lt;?php<br /> <br /> class tagcloud_model<br /> {<br /> <br /> var $tags;<br /> <br /> function get_tags()<br /> {<br /> <br /> usort($this-&gt;tags, array("tagcloud_model", "compare_names"));<br /> <br /> }<br /> <br /> <br /> function', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
