('rCu1496037750c8C', 'p4l1495689721U0y', '875', 0, 'question_multichoice', 60, 15, 'Checkboxes allow you to select more than one option in a checkbox group.', 'Radio buttons, unlike checkboxes, only allow you to select one option in a radio group.', '', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('RE014960377492AE', 'HIl1495689721FL6', '321', 0, 'question_multichoice', 60, 15, 'Text areas are used to allow users to enter multiple lines of text', 'As you learned in the previous lesson, radio buttons lets a user select ONLY ONE of a number of choices', 'Ans: Option 2 - Lets a user select ONE or MORE options of a number of choices', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('rF61496037751MTc', 'Hix1495689721ED9', '1505', 1, 'question_multichoice', 60, 15, 'You don"t need a framework to use JavaScript with PHP.', 'Frameworks don"t increase compatibility with servers.', 'To speed up app development.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
