('rNM1496037751plz', 'iaE1495689721owa', '1401', 1, 'question_multichoice', 60, 15, 'Remember the nice fancy image!', 'There is more than 1 group.', '3', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
