('rrB14960377514oW', 'JoX1495689721oBj', '1470', 1, 'question_multichoice', 60, 15, 'This is NOT a Python course.', 'JavaScript does run on the server, but it is mostly a client-side language.', 'PHP is a server-side programming language.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('RSw1496037751J5U', 'C2L1495689721xIg', '1497', 1, 'question_textarea', 100, 25, 'String data types are created by placing quotes around the text OR numbers.', 'To properly create a variable with a number data type, you need to NOT use quotes around the numbers.', '$donuts = 4;<br /> $coffee = 3;<br /> <br /> $total = $donuts + $coffee;', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
('RtJ1496037751OnI', 'rwx1495689721HQD', '1117', 0, 'question_multichoice', 60, 15, 'Using apps like Photoshop is fine, but it is a slow way of doing things these days.', 'Going to websites is also kinda slow.', 'Use the browser"s developer tools and use the color pickers there.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
