('RUr1496037749Rp5', 'E8N1495689721ZCH', '80', 0, 'question_multichoice', 60, 15, '&quot;href&quot; is a hyperlink attribute and not the tag', 'The &lt;hyper&gt; tag is not a valid HTML tag', 'Ans: Option 2 - &lt;a&gt;', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
