('Rwl1496037749o9h', 'tOz1495689721TQb', '309', 0, 'question_textarea', 100, 25, 'Use the "isset" function: isset();', '- Check to see if the super global $_POST["submit"] is set<br /> - echo &quot;form submitted&quot;;', 'Ans:<br /> <br /> &lt;form action=&quot;&quot; method=&quot;post&quot; id=&quot;form&quot;&gt; <br /> <br /> &lt;label for=&quot;name&quot;&gt;Name:&lt;/label&gt;<br /> &lt;input type=&quot;text&quot; name=&quot;name&quot; id=&quot;name&quot; class=&quot;', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('RWr1496037749Kfn', 'Hv91495689721jeZ', '245', 1, 'question_textarea', 100, 25, 'Change both the header and nav divs to reflect HTML5 syntax.', 'Use the &lt;header&gt; and &lt;nav&gt; tags.', 'Ans:<br /> <br /> &lt;header&gt;<br /> &lt;a href=&quot;#&quot; id=&quot;logo&quot;&gt;Home&lt;/a&gt;<br /> &lt;h1&gt;Killersites University: HTML5 Training&lt;/h1&gt;<br /> &lt;/header&gt;<br /> <br /> &lt;nav&gt;<br /> &lt;ul&gt;<br /> &lt;li&gt;&lt;a h', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('RwW1496037749iF1', 'dIA1495689721YYA', '221', 1, 'question_textarea', 100, 25, 'You first need to start your session', 'Remember the sessions super global: $_SESSION. Also, dont forget to use two different PHP blocks. The session start function must always be in its own php block on the top of the page.', 'Ans:<br /> &lt;?php session_start(); ?&gt;<br /> <br /> &lt;?php echo $_SESSION["time"]; ?&gt;', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('RYM1496037750bDh', 'A3T1495689721BfA', '874', 4, 'question_textarea', 100, 25, 'Checkboxes are created with HTML input tags.', 'A basic input tag looks like this: &lt;input&gt;. To create a checkbox, you use the "type" attribute.', '&lt;input type=&quot;checkbox&quot; name=&quot;fruit&quot; value=&quot;apple&quot;&gt;', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
('rys1496037751dSz', 'ocI1495689721cuM', '1176', 0, 'question_multichoice', 60, 15, '"visibility: hidden" can be used on all tags inside of &lt;body&gt; ... including the body tag too.', 'There is a difference.', 'With "display: none", the tag is taken out of the flow, where with "visibility: hidden", the tag cannot be seen, but it is STILL in flow.', '2017-05-29 02:32:31', '2017-05-29 02:32:31'),
