('sbR1496037750G1U', 'fUX1495689721DVv', '918', 5, 'question_textarea', 100, 25, 'The document type code has this code: !DOCTYPE', 'Be sure to start and end the doctype with the pointy brackets: &lt;&gt;', '&lt;!DOCTYPE html&gt;', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
