('zxm1496037749SS6', 'ues14960377493b2', 'Rewrite the &lt;!DOCTYPE&gt;, &lt;html&gt;, and &lt;meta&gt; tags to use proper HTML5 syntax', 'html', '#<!DOCTYPEs*(HTML|html)s*>s*<s*htmls*>s*<s*heads*>s*<s*metas*charsets*=s*(s*utf-8s*|s*UTF-8s*)>s*<s*titles*>s*Killersitess*Universitys*:s*HTML5s*</title>s*</head>s*#', 'regular_expression', 0, 5, '100', '2017-05-29 02:32:29', '2017-05-29 02:32:29'),
('ZxR1496037750QvQ', '3Mr1496037750L9D', 'The "lang" attribute can be added to any tag.', '', '1', '', 0, 10, '45', '2017-05-29 02:32:30', '2017-05-29 02:32:30'),
